import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  display: grid;
  margin-top: 20%;
  width: 100%;
  .impact-inner{
    padding: 5%;
  }

  @media (min-width: 768px) {
    display: flex;
    height: 90vh;
  }

`;

function Impact() {
  return (
    <Wrapper>
      <div className="impact-inner">
      <div className="impact-left">
          <p>Uncommon Impact</p>
          <h2>
            Education = <br /> Earning Power.
          </h2>
          <p>
            Our mission is to help unemployed young adults from low-income
            communities launch their careers in the technology industry.
          </p>
      </div>
      <div className="impact-right">
        <video src="./images/vid.mp4" width="290" height="240" controls className="vid">play this video</video>
      </div>
      </div>
    </Wrapper>
  );
}

export default Impact;
